import { styled } from "styled-components"

const StyledVoteForSmile = styled.div`
  li {
    list-style: none;
  }
`

export default function VoteForSmile() {
  return (
    <div>
      <ul>
        <li>&#128125;</li>
        <li>&#128122;</li>
        <li>&#128121;</li>
        <li> &#128169;</li>
        <li>&#129313;</li>
      </ul>
    </div>
  )
}
